export const Register = (props: RouteComponentProps) => {
  return (
    <Box d="flex" justifyContent="center" alignItems="center" w="100vw" h="100vh" mt="-60px">
      <Box position="absolute" top="100" right="100">
        <ColorModeSwitcher />
      </Box>
      <AccountCard type="register" />
    </Box>
  )
}
